import { useParams, Link } from "react-router-dom";
import EventsList from "./EventsList";


function EventDetailPage(){
    const params = useParams();

    return (
        <>
        <h1>
            Event overview
        </h1>
        <p>{params.eventid}</p>
        <Link to = "../.." relative="path">Back</Link>
        <EventsList/>
        </>
    );}

export default EventDetailPage;

